import { jsx, css } from '@emotion/react'
import styled from '@emotion/styled'
import { Wrapper } from '../style'

function Post(props) {
  const { id, title, userId, body } = props

  const MainFonts = styled.div`
    color: red;
    font-size: 16px;
    font-family: Roboto;
  `
  const hotpink = css({
    color: 'hotpink',
  })

  return (
    <Wrapper>
      <MainFonts>
        <p css={hotpink}>This is hotpink</p>
      </MainFonts>
      <small>{id} </small>
      <h1>{title} </h1>
      <p>{body} </p>
      <h3>{userId} </h3>
    </Wrapper>
  )
}

export default Post
